import './index.css';

function Square({value}) {
  return <button className='square'>1</button>
}

export default function Board() {
  return (
    <>
    <div className='board-row'>
      <Square />
      <Square />
      <Square />
    </div>
    <div className='board-row'>
      <Square />
      <Square />
      <Square />
    </div>
    <div className='board-row'>
      <Square />
      <Square />
      <Square />
    </div> 
    </>
  );
}
